INSERT INTO `courses` (`id`, `title`, `duration`, `discount_fee`, `image`, `fee`, `instructor`, `description`, `status`, `created_at`, `updated_at`) VALUES
(2, 'Python With Data Structure', '2', '1500', '1639911906.jpg', '2500', 'Sadique Hussain', 'Welcome to the Complete Data Structures and Algorithms in Python Bootcamp, the most modern, and the most complete Data Structures and Algorithms in Python course in Purnea.\r\n\r\nthis is the most comprehensive course to help you ace your coding interviews and learn about Data Structures and Algorithms in Python. You will see at the top technology companies such as Apple, Amazon, Google and Microsoft and how to face Interviews with comprehensive visual which will bring you closer towards landing the tech job of your dreams!\r\n\r\nLearning Python is one of the fastest ways to improve your career prospects as it is one of the most in demand tech skills! This course will help you in better understanding every detail of Data Structures and how algorithms are implemented in high level programming language.\r\n\r\nWe\'ll take you step-by-step through Day Basic Classes and teach you everything you need to succeed as a professional programmer.\r\n\r\nAfter finishing this course, you will be able to:\r\nLearn basic algorithmic techniques such as greedy algorithms, binary search, sorting and dynamic programming to solve programming challenges.\r\nLearn the strengths and weaknesses of a variety of data structures, so you can choose the best data structure for your data and applications\r\nLearn many of the algorithms commonly used to sort data, so your applications will perform efficiently when sorting large datasets\r\nLearn how to apply graph and string algorithms to solve real-world challenges: finding shortest paths on huge maps and assembling genomes from millions of pieces.', 1, '2021-12-19 05:35:06', '2021-12-19 05:35:06'),
(3, 'Web Development with Django & Sqlite', '3', '2100', '1639915439.jpg', '4500', 'Sadique Hussain', 'Django is an extremely popular and fully featured server-side web framework, written in Python. This module shows you why Django is one of the most popular web server frameworks, how to set up a development environment, and how to start using it to create your own web applications.', 1, '2021-12-19 06:33:59', '2021-12-19 06:33:59'),
(4, 'MangoDB, ExpressJS, ReactJS, Nodejs full stack Development', '4', '3000', '1639916039.jpg', '9999', 'Sadique Hussain', 'Learn to build entire web applications from start to finish on one of the most versatile tech stacks : MongoDB, Express.js, React.js and Node.js (MERN stack)', 1, '2021-12-19 06:43:59', '2021-12-19 06:43:59'),
(5, 'Laravel Web Development with Php', '4', '2899', '1639916450.jpg', '8500', 'Sadique Hussain', 'Laravel is a web application framework with expressive, elegant syntax. We’ve already laid the foundation — freeing you to create without sweating the small things.', 1, '2021-12-19 06:50:50', '2021-12-19 06:50:50'),
(6, 'ReactJs with Postman API', '2', '1500', '1639916867.jpg', '6500', 'Sadique Hussain', 'Build powerful, fast, user-friendly and reactive web apps. Provide amazing user experiences by leveraging the power of JavaScript with ease. Apply for high-paid jobs or work as a freelancer in one the most-demanded sectors you can find in web dev right now. Learn all about React Hooks and React Components. \r\n\r\nThis course is the most up-to-date, comprehensive React course. It was completely updated from the ground up - it teaches the very latest version of React with all the core, modern features you need to know!\r\n\r\n---------------------------------\r\nReact.js is THE most popular JavaScript library you can use and learn these days to build modern, reactive user interfaces for the web.\r\nThis course teaches you React in-depth, from the ground up, step by step by diving into all the core basics, exploring tons of examples and also introducing you to advanced concepts as well.', 1, '2021-12-19 06:57:47', '2021-12-19 06:57:47'),
(8, 'Android Development with React Native', '3', '4500', '1654318489.png', '10500', 'Sadique Hussain', 'Mobile apps are one of the best ways to engage with users - no wonder everyone wants to build one!\r\n\r\nWouldn\'t it be great if you could use your web development knowledge, combined with your React knowledge, to build mobile apps with that?\r\n\r\nThat\'s exactly what React Native allows you to do!\r\n\r\nNo need to learn Java, Android, Swift, ObjectiveC or anything of that - React and JavaScript is all you need to create awesome native mobile apps that work on both Android and iOS. That\'s probably the reason why Instagram, AirBnB, Skype and many other global companies are using it to build their mobile apps!\r\n\r\nWith this course, you can join this league. I\'ll teach you all you need to create your own React Native apps, publish them to the Google Play Store and Apple App Store and dive really deep into the React Native ecosystem.', 1, '2022-06-03 23:24:49', '2022-06-03 23:24:49');
